import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 54.1-3011.1 Additional fee required for licensure of certain practitioners.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3011.1.md","filePath":"vacode/54.1-3011.1.md"}'),i={name:"vacode/54.1-3011.1.md"},o=t('<h1 id="§-54-1-3011-1-additional-fee-required-for-licensure-of-certain-practitioners" tabindex="-1">§ 54.1-3011.1 Additional fee required for licensure of certain practitioners. <a class="header-anchor" href="#§-54-1-3011-1-additional-fee-required-for-licensure-of-certain-practitioners" aria-label="Permalink to &quot;§ 54.1-3011.1 Additional fee required for licensure of certain practitioners.&quot;">​</a></h1><p>In addition to the fees authorized for licensure and renewal by § <a href="http://law.lis.virginia.gov/vacode/54.1-2400/" target="_blank" rel="noreferrer">54.1-2400</a>, the Board is authorized to charge a fee not to exceed one dollar for the licensure of every practical nurse and registered nurse to be deposited in the Nursing Scholarship and Loan Repayment Fund established pursuant to § <a href="http://law.lis.virginia.gov/vacode/54.1-3011.2/" target="_blank" rel="noreferrer">54.1-3011.2</a>. Such fees shall be used to fund scholarships established pursuant to subsection A of § <a href="http://law.lis.virginia.gov/vacode/32.1-122.6:01/" target="_blank" rel="noreferrer">32.1-122.6:01</a>.</p><p>1991, c. 669; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0240" target="_blank" rel="noreferrer">240</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0254" target="_blank" rel="noreferrer">254</a>.</p>',3),n=[o];function s(c,l,d,f,h,u){return r(),a("div",null,n)}const g=e(i,[["render",s]]);export{p as __pageData,g as default};
